import React from 'react'
import styled, { keyframes } from "styled-components"
// import keyframes from "styled-components"

const AnimateWheel = keyframes`
    from {
        margin-top: 15px;
        opacity: 0.7;
        border: 2px solid #494B6444;
        background-color: #494B6444;
      }

      60% {
        margin-top: 15px;
        opacity: 0.7;
        background-color: #494B6444;
        border: 2px solid #494B6444;
      }

      62% {
        background-color: #494B6444;
        border: 2px solid #494B6444;
      }

      66% {
        margin-top: 15px;
        opacity: 0.9;
        background-color: #494B6477;
        border: 2px solid #494B6499;
      }

      68% {
        margin-top: 4px;
        opacity: 1;
      }

      70% {
        margin-top: 17px;
        opacity: 0.9;
      }

      72% {
        margin-top: 13px;
        opacity: 0.9;
      }

      74% {
        margin-top: 15px;
        opacity: 0.9;
        background-color: #494B6477;
        border: 2px solid #494B6499;
      }

      76% {
        margin-top: 15px;
        opacity: 0.7;
      }

      78% {
        margin-top: 15px;
        background-color: #494B6444;
        border: 2px solid #494B6444;
      }

      to {
        margin-top: 15px;
        background-color: #494B6444;
        border: 2px solid #494B6444;
      }
}
`

const AnimateBorder = keyframes`
    from {
        border: 2px solid #494B6444;
      }

      60% {
        border: 2px solid #494B6444;
      }

      64% {
        border: 2px solid #494B6477;
      }

      72% {
        border: 2px solid #494B6477;
      }

      76% {
        border: 2px solid #494B6444;
      }

      to {
        border: 2px solid #494B6444;
      }
}
`

const Border = styled.div`
    height: 30px;
    width: 16px;
    border: 2px solid #494B64;
    border-radius: 16px;
    opacity: 0.5;
    animation: ${AnimateBorder} 12s ease-in-out infinite;
`

const Wheel = styled.div`
    border: 2px solid #494B6444;
    border-radius: 16px;
    height: 8px;
    width: 2px;
    margin-top: 15px;
    margin-left: 5px;
    background-color: #494B6499;
    animation: ${AnimateWheel} 12s ease-in-out infinite;
    opacity: 0.7;
`

export default function Scroll () {
    return (
        <Border>
            <Wheel></Wheel>
        </Border>
    )
}
